import React from "react";
import Form from 'react-bootstrap/Form';

const Todo = ({ todo } ) => {
    return (
        <Form>
            <Form.Check
            disabled
            type="checkbox"
            label={todo.text}
            id="default-checkbox"
            checked={todo.complete}
            />
      </Form>
    )
};

export default Todo;
